import React from 'react';

const Header = () => {
    return (
        <nav className='navbar navbar-expand-lg navbar-light bg-light'>
            <a href='/'>Home</a>
            <a href='/course'>Courses</a>
            <a href='/about'>About</a>
        </nav>
    );
};

export default Header;
